# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

# Definition for a binary tree node.
class TreeNode:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

class Solution:
    def isSubPath(self, head: ListNode, root: TreeNode) -> bool:
        # 这个树的话用的应该是深度优先遍历
        def dfs(head, root):
            if head is None:
                return True
            if root is None:
                return False
            if root.val == head.val:
                # 要注意这个链表中间不能断，断了就要重新开始
                return dfs(head.next,root.left) or dfs(head.next, root.right)
            else:
                if root.val == head_init.val:
                    return dfs(head_init.next, root.left) or dfs(head_init.next, root.right)
                else:
                    return dfs(head_init, root.left) or dfs(head_init, root.right)
        head_init = head
        return dfs(head,root)

